import React from "react";
import '../../folder_css/css_two.css'
import 'bootstrap/dist/css/bootstrap.min.css';

export default function SanPham() {
    return (
      <div className="giao-dien-product">
        <h2 className="Text-Name">Sản Phẩm ADMIN</h2> 
        <div>
          <button class="button button1"><img alt="IMG_1" src={require("../../folder_css/img/10.png")} style={{marginRight: 10 ,width : 20 , height: 20 ,}}></img>Thêm Sản Phẩm</button>
          <button class="button button2">Danh Sách Sản Phẩm</button>
          <div class="form-outline">
           <input type="text" id="form1" onChange={(e)=>setSearch(e.target.value)} class="form-control" placeholder="Search Employee Here" style={{backgroundColor:"#ececec"}}/>
        </div>
         <button type="button" onClick={searchRecords}  class="btn btn-success">
         <i class="fa fa-search" aria-hidden="true"></i>
        </button>
        </div>      
      </div>
    );
  }
